import basic from "./css/basic.css";
import Slider from "./Slider.js";
import FooterComponent from "./components/FooterComponent";



function App() {
  return (
    <div>
      <HeaderComponent />
      <Slider />
      <MainPageComponent />
      <FooterComponent />
    </div>
  );
}

export default App;
